import React, { Component } from "react";
class Home extends Component {
  render() {
    return (
      <div align="center">
      <div class="contener_slideshow">
        <div class="contener_slide">
          <div class="slid_1"><img src="https://mdbootstrap.com/img/Photos/Slides/img%20(130).jpg"/></div>
          <div class="slid_2"><img src="https://mdbootstrap.com/img/Photos/Slides/img%20(129).jpg"/></div>
          <div class="slid_3"><img src="https://mdbootstrap.com/img/Photos/Slides/img%20(70).jpg"/></div>
        </div>
      </div>
    </div>

    );
  }
}

export default Home;
